// 重构3x3卷积权重的辅助函数
function reshapeConv3x3Weights(flatWeights, outChannels, inChannels) {
  var weights = [];
  var idx = 0;
  for (var out = 0; out < outChannels; out++) {
    var outWeights = [];
    for (var inp = 0; inp < inChannels; inp++) {
      var kernel = [];
      for (var k = 0; k < 9; k++) {
        kernel.push(flatWeights[idx++]);
      }
      outWeights.push(kernel);
    }
    weights.push(outWeights);
  }
  return weights;
}

